<!DOCTYPE html>
<html lang="en">

<head>
	<title>Oneohtrix Point Never | SVG Images</title>
	<!-- META -->
	<meta charset="utf-8">
	<!-- CSS -->
	<link rel="stylesheet" href="normalize.css">
	<link rel="stylesheet" href="main.css">
</head>

<body>
	<!-- PAGE CONTENT -->
	<div id="wrapper">
		<div class="svg-img" id="commissions-a">
			<object data="img/CommissionsI.svg" type="image/svg+xml">
				<img src="img/CommissionsI.png" alt="Commissions I">
			</object>
		</div>
		<div class="svg-img" id="commissions-b">
			<object data="img/CommissionsII.svg" type="image/svg+xml">
				<img src="img/CommissionsII.png" alt="Commissions II">
			</object>
		</div>
		<div class="svg-img" id="tree-of-delete">
			<object data="img/TreeOfDelete.svg" type="image/svg+xml">
				<img src="img/TreeOfDelete.png" alt="Tree of Delete">
			</object>
		</div>
		<div class="svg-img" id="myriad">
			<object data="img/MyriadTypesets.svg" type="image/svg+xml">
				<img src="img/MyriadTypesets.png" alt="Myriad Typesets">
			</object>
		</div>
		<div class="svg-img" id="rifts">
			<object data="img/Rifts.svg" type="image/svg+xml">
				<img src="img/Rifts.png" alt="Rifts">
			</object>
		</div>
	</div>
	<!-- JAVASCRIPT-->
	<script src="main.js"></script>
</body>

</html>
